Teaser:
Suorita C/C++-ohjelmasi ChATGPT:ssä tämän kehotteen avulla. Tämä on erittäin tehokas kehote ajaa kaikenlaisia koodauskieliä suoraan verkkoselaimessa Chatgpt:n avulla.

 Kirjoita vain C- tai C++-koodi, jonka haluat suorittaa kehotteeseen, ja Chat-GPT antaa sinulle ohjelman tulosteen vastauksena.

 Tämä on hyödyllistä, jos tietokoneellesi ei ole asennettu kääntäjää ja haluat testata koodia nyt, voit tehdä sen yksinkertaisella kehotuksella.

 Esimerkki C++-koodista.
 #include <Istream>

 int main() {
  std::cout << "Hei chat-gpt3" << std::endl;
  paluu 0;
 }
